import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Form } from "react-bootstrap";

const FormDirection = () => {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>
          <Form>
            <Form.Group controlId="formGridAddress">
              <Form.Label
                style={{
                  fontFamily: "GothamBold",
                  fontSize: "15px",
                }}
              >
                Calle
              </Form.Label>
              <Form.Control
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",
                }}
                placeholder="Ingresa tu dirección"
              />
            </Form.Group>

            <Form.Row>
              <Form.Group as={Col} controlId="formGridNoExt">
                <Form.Label>No. Ext</Form.Label>
                <Form.Control
                  style={{
                    fontSize: "13px",
                  }}
                />
              </Form.Group>

              <Form.Group as={Col} controlId="formGridNoInt">
                <Form.Label>No. Int</Form.Label>
                <Form.Control
                  style={{
                    fontSize: "13px",
                  }}
                />
              </Form.Group>

              <Form.Group as={Col} controlId="formGridCp">
                <Form.Label>C.P.</Form.Label>
                <Form.Control
                  style={{
                    fontSize: "13px",
                  }}
                />
              </Form.Group>
            </Form.Row>

            <Form.Group controlId="formGridAddress2">
              <Form.Label>Colonia</Form.Label>
              <Form.Control
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",
                }}
                placeholder="Ingresa tu colonia"
              />
            </Form.Group>

            <Form.Group controlId="formGridReference">
              <Form.Label>Referencias y/o entre calles</Form.Label>
              <Form.Control
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",
                }}
                placeholder="Ingresa tus referencias"
              />
            </Form.Group>

            <Form.Group controlId="formGridAlias">
              <Form.Label>Escribe un alias</Form.Label>
              <Form.Control
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",
                }}
                placeholder="Ingresa un alias"
              />
            </Form.Group>

            <Form.Group controlId="formGridPhoneNum">
              <Form.Label>Número celular</Form.Label>
              <Form.Control placeholder="(55) 5555-5555" />
            </Form.Group>
          </Form>
        </Col>
      </Row>
    </Container>
  );
};

export default FormDirection;
